import React from 'react'
import styled from 'styled-components'

import MenuNavItems from './MenuNavItems.js'

const FixedWrapper = styled.header`
    position: relative;
    background-color: var(--color-white);
    width: 100%;
    height: 6rem;
`

const MenuNavbar = () => {
    return(
        <FixedWrapper>
            <Ul>
            <MenuNavItem clicked = {clicked}> Food </MenuNavItem>
            <MenuNavItem clicked = {clicked}> Drinks </MenuNavItem>
        </Ul>
        </FixedWrapper>
    )
}

export default MenuNavbar
